1, 51);\">Registration includes: conference sessions, networking luncheons and conference receptions. Simultaneous translation from Mandarin to English (and vice versa) for all CHAT Shanghai sessions will be provided by professional translators. Travel and lodging arrangements are the sole responsibility of the delegate and not included in the registration fee. An e-mail confirmation will be sent to you upon receipt of your registration information. Contact information you provide may be shared with other conference attendees and sponsors to facilitate networking and building professional relationships, and to inform you about the conference. The host may use your contact details to advise you of other events and related information. Please contact us in writing if you do not want this information shared. All participants must wear their name badge at all programs/functions held in conjunction with CHAT Shanghai. CHAT host reserves the right to qualify all registrants and allow or prohibit anyone from attending this event. Topics, speakers, agenda, networking and other conference events are subject to change without notice.</span></span></span><span lang=\"EN-US\" new=\"\" style=\"color: rgb(51, 51, 51); font-family:;\" times=\"\"><o:p></o:p></span></p>\r\n<p style=\"background: rgb(249, 249, 249); line-height: 16.5pt;\">\r\n	<span style=\"font-size: 14px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><b><u><span lang=\"EN-US\" style=\"color: maroon;\">Reminder</span></u></b></span></span><b><u><span lang=\"EN-US\" new=\"\" style=\"color: maroon; font-family:;\" times=\"\"><o:p></o:p></span></u></b></p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-size: 14px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><span lang=\"EN-US\" style=\"color: rgb(51, 51, 51);\">1.The badge will be printed according to the registered information. Should any changes be made after September 8, there will be an additional amendment charge of RMB 200.</span></span></span><span lang=\"EN-US\" new=\"\" style=\"color: rgb(51, 51, 51); font-family:;\" times=\"\"><o:p></o:p></span></p>\r\n<p style=\"background: rgb(249, 249, 249); line-height: 16.5pt;\">\r\n	<span style=\"font-size: 14px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><span lang=\"EN-US\" style=\"color: rgb(51, 51, 51);\">2.The Fa Piao will be printed according to the registered Fa Piao information and distributed during the event. Please note the CHAT host will not held responsible for any request afterwards. </span></span></span><span lang=\"EN-US\" new=\"\" style=\"color: rgb(51, 51, 51); font-family:;\" times=\"\"><o:p></o:p></span></p>\r\n<p style=\"background: rgb(249, 249, 249); line-height: 16.5pt;\">\r\n	<span style=\"font-size: 14px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><b><u><span lang=\"EN-US\" style=\"color: maroon;\">Cancellations and Refunds</span></u></b></span></span><b><u><span lang=\"EN-US\" new=\"\" style=\"color: maroon; font-family:;\" times=\"\"><o:p></o:p></span></u></b></p>\r\n<p>\r\n	<span style=\"font-size: 14px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><span lang=\"EN-US\" style=\"color: rgb(51, 51, 51);\">Cancellation requests are by written request from the delegate only and apply to the policy in effect on the date the notification is received by the CHAT host. Any cancellation that is received before August 17, 2014 will be charged 50% of the total registration fee. We regret that no refunds can be made after August 17, 2014. Registrations are transferable to other persons interested in attending this event only (CHAT Shanghai September 17-18, 2014), with written notice from the delegate.</span></span></span></p>\r\n<p>\r\n	<span style=\"font-size: 14px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><br />\r\n	</span></span></p>\r\n<p>\r\n	<span style=\"font-size: 14px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><strong>I have read, understood and 