s=\"\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 16.5pt; mso-margin-bottom-alt: auto; mso-margin-top-alt: auto;\">\r\n	<span style=\"font-family: arial,helvetica,sans-serif;\"><b><u><span style=\"color: maroon; font-size: 10.5pt;\">酒店住宿</span></u></b><span lang=\"EN-US\" style=\"font-size: 10pt;\"><br />\r\n	</span><span style=\"font-size: 10pt;\">　　会费不包括酒店住宿，作为论坛协办单位及会场赞助单位的上海世博洲际酒店为论坛与会人士预留了特价优惠房间。请点击<a href=\"http://www.chatchina.com.cn/category/venue/\" target=\"_blank\">此处</a>预定客房。</span><span lang=\"EN-US\" style=\"font-size: 10pt;\"><br />\r\n	</span><span style=\"font-size: 10pt;\">订房热线</span><span lang=\"EN-US\" style=\"font-size: 10pt;\">: </span><span lang=\"EN-US\" style=\"font-size: 10pt;\">+86.021.3858.1188</span><span style=\"font-size: 10pt;\">转</span><span lang=\"EN-US\" style=\"font-size: 10pt;\">5171</span></span><span lang=\"EN-US\" new=\"\" style=\"font-family:;\" times=\"\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 16.5pt; mso-margin-bottom-alt: auto;\">\r\n	<span style=\"font-family: arial,helvetica,sans-serif;\"><b><u><span style=\"color: maroon; font-size: 10.5pt;\">条款及限制</span></u></b><span lang=\"EN-US\" style=\"font-size: 10pt;\"><br />\r\n	</span><span style=\"font-size: 10pt;\">　　参会费包括：所有</span><span lang=\"EN-US\" style=\"font-size: 10pt;\">CHAT</span><span style=\"font-size: 10pt;\">上海论坛相关会议资料、交流午餐和会议茶点招待。组委会将提供专业翻译对</span><span lang=\"EN-US\" style=\"font-size: 10pt;\">CHAT</span><span style=\"font-size: 10pt;\">上海论坛的全部内容进行同声翻译（英译中及中译英）。参会代表需自行负责住宿及差旅安排，有关费用不包含在注册费内。在收到您的注册信息后，我们将通过电邮发送确认函。我们将与其他参会代表和赞助商分享您的联系资料，以便促进交流联系，并通知您有关</span><span lang=\"EN-US\" style=\"font-size: 10pt;\">CHAT</span><span style=\"font-size: 10pt;\">上海论坛的详情。主办单位也将可能通知您有关其他活动的相关信息。如果您不愿分享您的联系资料，请书面通知我们。所有参会代表出席</span><span lang=\"EN-US\" style=\"font-size: 10pt;\">CHAT</span><span style=\"font-size: 10pt;\">上海论坛的任何活动时必须全程佩戴胸牌。</span><span lang=\"EN-US\" style=\"font-size: 10pt;\">CHAT</span><span style=\"font-size: 10pt;\">上海论坛主办方保留对注册者资格进行筛选及允许或禁止任何人士出席此项活动的权利。</span><span lang=\"EN-US\" style=\"font-size: 10pt;\">CHAT</span><span style=\"font-size: 10pt;\">上海论坛讨论的议题、演讲嘉宾名单、议程安排、联系资料和其他</span><span lang=\"EN-US\" style=\"font-size: 10pt;\">CHAT</span><span style=\"font-size: 10pt;\">上海论坛活动信息如有任何变更，恕不另行通知。</span></span><span lang=\"EN-US\" new=\"\" style=\"font-family:;\" times=\"\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-family: arial,helvetica,sans-serif;\"><b><u><span style=\"color: maroon; font-size: 10.5pt;\">温馨提示</span></u></b></span><b><u><span lang=\"EN-US\" new=\"\" style=\"color: maroon; font-family:;\" times=\"\"><o:p></o:p></span></u></b></p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-family: arial,helvetica,sans-serif;\"><span lang=\"EN-US\" style=\"font-size: 10pt;\">　　1. </span><span style=\"font-size: 10pt;\">主办方将按照您注册时提供的信息打印您的名牌。若在</span><span lang=\"EN-US\" style=\"font-size: 10pt;\">9</span><span style=\"font-size: 10pt;\">月</span><span lang=\"EN-US\" style=\"font-size: 10pt;\">8</span><span style=\"font-size: 10pt;\">号后有更改名牌上信息的需求将被收取</span><span lang=\"EN-US\" style=\"font-size: 10pt;\">200</span><span style=\"font-size: 10pt;\">元人民币变更费用。</span></span><span lang=\"EN-US\" new=\"\" style=\"font-family:;\" times=\"\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-family: arial,helvetica,sans-serif;\"><span lang=\"EN-US\" style=\"font-size: 10pt;\">　　2. </span><span style=\"font-size: 10pt;\">有发票需求并在注册时留下准确信息的与会者须在会议现场统一领取发票，逾期将不予受理。</span></span><span lang=\"EN-US\" new=\"\" style=\"font-family:;\" times=\"\"><o:p></o:p></span></p>\r\n<p>\r\n	<span style=\"font-family: arial,helvetica,sans-serif;\"><b style=\"line-height: 16.5pt;\"><u><span style=\"color: maroon; font-size: 10.5pt;\">注册取消及退款</span></u></b></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 16.5pt; mso-margin-bottom-alt: auto; mso-margin-top-alt: auto;\">\r\n	<span style=\"font-family: arial,helvetica,sans-serif;\"><span style=\"font-size: 10pt;\">　　若需取消本次</span><span lang=\"EN-US\" style=\"font-size: 10pt;\">CHAT</span><span style=\"font-size: 10pt;\">上海论坛的注册必须由参会代表书面通知，并根据</span><span lang=\"EN-US\" style=\"font-size: 10pt;\">CHAT</span><span style=\"font-size: 10pt;\">上海论坛会务组收到有关通知起当日生效。取消注册函必须于</span><span lang=\"EN-US\" style=\"font-size: 10pt;\">2014</span><span style=\"font-size: 10pt;\">年</span><span lang=\"EN-US\" style=\"font-size: 10pt;\">8</span><span style=\"font-size: 10pt;\">月</span><span lang=\"EN-US\" style=\"font-size: 10pt;\">17</span><span style=\"font-size: 10pt;\">日之前提交给主办单位，我们将从退款中扣除每位</span><span lang=\"EN-US\" style=\"font-size: 10pt;\">50%</span><span style=\"font-size: 10pt;\">的费用作为行政费用。</span><span lang=\"EN-US\" style=\"font-size: 10pt;\">2014</span><span style=\"font-size: 10pt;\">年</span><span lang=\"EN-US\" style=\"font-size: 10pt;\">8</span><span style=\"font-size: 10pt;\">月</span><span lang=\"EN-US\" style=\"font-size: 10pt;\">17</span><span style=\"font-size: 10pt;\">日之后取消注册须承担全部的费用。已注册者可通过书面形式通知主办单位，将其参会资格转让予其他有兴趣参与</span><span lang=\"EN-US\" style=\"font-size: 10pt;\">CHAT上海论坛（2014年9月17日至18日）的人士。</span></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 16.5pt; mso-margin-bottom-alt: auto; mso-margin-top-alt: auto;\">\r\n	&nbsp;</p>\r\n<p class=\"MsoNormal\">\r\n	<strong><span style=\"line-height: 22px;\">我已阅读，理解并同意遵守以上条款。</span></strong></p>\r\n');
