INSERT INTO `end_wt_email_template_data` VALUES ('2', 'chat_order_created', 'CHAT上海付款通知 | CHAT Shanghai Payment Reminder', '<p>\r\n	<span style=\"font-family:microsoft yahei;\"><span style=\"font-size:12px;\">这是一封系统邮件，请勿回复！若有任何需求，请发送至<a href=\"mailto:lluo@horwathhtl.com\">lluo@horwathhtl.com</a>垂询，谢谢！/ This is an automatic email sent by the systerm, please do not reply! Should you have further questions, please contact&nbsp;<a href=\"mailto:lluo@horwathhtl.com\">lluo@horwathhtl.com</a></span></span></p>\r\n<p>\r\n	<span style=\"font-family:microsoft yahei;\"><span style=\"font-size:12px;\"><em>For English, please scroll down.</em></span></span></p>\r\n<hr />\r\n<p>\r\n	<span style=\"font-family:microsoft yahei;\"><span style=\"font-size:14px;\"><br />\r\n	</span></span></p>\r\n<p>\r\n	<span style=\"font-family:microsoft yahei;\"><span style=\"font-size:14px;\">尊敬的%contact_name%：</span></span></p>\r\n<p>\r\n	<span style=\"font-family:microsoft yahei;\"><span style=\"font-size: 14px;\">感谢您已成功注册2014 CHAT上海&mdash;资产管理与运营论坛的参会信息！</span></span></p>\r\n<p>\r\n	<span style=\"font-family:microsoft yahei;\"><span style=\"font-size: 12pt;\">您的订单号是</span><span style=\"font-size: 14px;\">%order_serial%。请直接点击以下网址完成付款。如果链接不能打开或者打开时出现错误，请将该网址复制并粘贴至浏览器打开。</span></span></p>\r\n<p>\r\n	<span style=\"font-family:microsoft yahei;\"><a href=\"%order_url%\" style=\"font-family: verdana, geneva, sans-serif; font-size: 14px;\">%order_url%</a></span></p>\r\n<p>\r\n	<span style=\"font-family:microsoft yahei;\"><span style=\"font-size:14px;\">您也可以通过登陆CHAT网站注册报名页面，点击&ldquo;管理历史订单&rdquo;，输入验证码查看订单状态、完成支付或修改注册信息。您的订单验证码：</span><span style=\"font-size: 14px;\">%certificate_number%</span></span></p>\r\n<p>\r\n	<span style=\"font-family:microsoft yahei;\"><span style=\"font-size: 14px;\">若有任何问题，请拨打电话 +86(0)10 8518 6636 或 8518 1833。再次感谢您对我们工作的支持！</span></span></p>\r\n<p>\r\n	<span style=\"font-family:microsoft yahei;\"><br />\r\n	</span></p>\r\n<p>\r\n	<span style=\"font-family:microsoft yahei;\"><span style=\"font-size:14px;\">　　顺颂</span></span></p>\r\n<p>\r\n	<span style=\"font-family:microsoft yahei;\"><span style=\"font-size:14px;\">商祺！</span></span></p>\r\n<p>\r\n	<span style=\"font-family:microsoft yahei;\"><br />\r\n	</span></p>\r\n<p>\r\n	<span style=\"font-family:microsoft yahei;\"><span style=\"font-size:14px;\">CHAT 会务组</span></span></p>\r\n<p>\r\n	<span style=\"font-family:microsoft yahei;\"><span style=\"font-size:14px;\"><br />\r\n	</span></span></p>\r\n<p>\r\n	<span style=\"font-family:microsoft yahei;\"><span style=\"font-size:14px;\"><br />\r\n	</span></span></p>\r\n<p>\r\n	<span style=\"font-family:microsoft yahei;\"><span style=\"font-size:14px;\">Dear %contact_name%,</span></span></p>\r\n<p>\r\n	<span style=\"font-family:microsoft yahei;\"><span style=\"font-size:14px;\">Thank you for registering CHAT Shanghai 2014 - Asset Management &amp; Operations!</span></span></p>\r\n<p>\r\n	<span style=\"font-family:microsoft yahei;\"><span style=\"font-size: 14px;\">Your order number is</span><span style=\"font-size:14px;\">&nbsp;</span><span style=\"font-size: 14px;\">%order_serial%</span><span style=\"font-size: 14px;\">&nbsp;and please kindly click the link below to submit the payment. If you cannot open this URL directly or some error happens, please kindly copy the URL and paste into your browser.</span></span></p>\r\n<p>\r\n	<span style=\"font-family:microsoft yahei;\"><a href=\"%order_url%\" style=\"font-family: verdana, geneva, sans-serif; font-size: 14px;\">%order_url%</a></span></p>\r\n<p>\r\n	<span style=\"font-family:microsoft yahei;\"><span style=\"font-size:14px;\">If inclines to pay by bank transfer, please make sure to include the Transfer ID in the transfer information.</span></span></p>\r\n<p>\r\n	<span style=\"font-family:microsoft yahei;\"><span style=\"font-size: 14px;\">You can also log in CHAT website registration page and enter your verification code to view your payment status, proceed your payment or edit your registration information. Your verification code is</span><span style=\"font-size:14px;\">&nbsp;</span><span style=\"font-size: 14px;\">%certificate_number%</span></span></p>\r\n<p>\r\n	<span style=\"font-family:microsoft yahei;\"><span style=\"font-size: 14px;\">We appreciate your patience and support! Should you look for further assistance, please call +86(0)10 8518 6636 or 8518 1833.</span></span></p>\r\n<p>\r\n	<span style=\"font-family:microsoft yahei;\"><span style=\"font-size:14px;\"><br />\r\n	</span></span></p>\r\n<p>\r\n	<span style=\"font-family:microsoft yahei;\"><span style=\"font-size:14px;\">Best regards,</span></span></p>\r\n<p>\r\n	<span style=\"font-family:microsoft yahei;\"><span style=\"font-size:14px;\">CHAT Committee</span></span></p>\r\n', '', '1402992973', '1401766597', '1');
