INSERT INTO `end_wt_email_template_data` VALUES ('4', 'chat_approve', 'CHAT参会订单审核提醒', '<p>\r\n	<span style=\"font-size:14px;\"><span style=\"font-family: verdana,geneva,sans-serif;\">您好！</span></span></p>\r\n<p>\r\n	<span style=\"font-size:14px;\"><span style=\"font-family: verdana,geneva,sans-serif;\">CHAT会议存在参会者报名订单（订单号：%order_serial%<span style=\"line-height: 20px;\">，联系人：%contact_name%，公司：%company_name%</span>）需要您审核。</span></span></p>\r\n<p>\r\n	<span style=\"font-size:14px;\"><span style=\"font-family: verdana,geneva,sans-serif;\"><br />\r\n	</span></span></p>\r\n<p>\r\n	<span style=\"font-size:14px;\"><span style=\"font-family: verdana,geneva,sans-serif;\">_____________</span></span></p>\r\n<p>\r\n	<span style=\"font-size:14px;\"><span style=\"font-family: verdana,geneva,sans-serif;\">CHAT报名注册系统</span></span></p>\r\n', '', '1402220302', '1401767286', '1');
INSERT INTO `end_wt_email_template_data` VALUES ('5', 'chat_success_contact', 'CHAT上海报名确认函 - 联系人 | CHAT Shanghai Confirmation of Registration- Contact Person', '<p align=\"left\" class=\"MsoNormal\">\r\n	<span style=\"font-family:microsoft yahei;\"><span style=\"font-size:12px;\">这是一封系统邮件，请勿回复！若有任何需求，请发送至<a href=\"mailto:lluo@horwathhtl.com\">lluo@horwathhtl.com</a>垂询，谢谢！/ This is an automatic email sent by the systerm, please do not reply! Should you have further questions, please contact&nbsp;<a href=\"mailto:lluo@horwathhtl.com\">lluo@horwathhtl.com</a></span></span></p>\r\n<p align=\"left\" class=\"MsoNormal\">\r\n	<span style=\"font-family:microsoft yahei;\"><span style=\"font-size:12px;\"><em>For English, please scroll down.</em></span></span></p>\r\n<hr />\r\n<p align=\"left\" class=\"MsoNormal\">\r\n	<span style=\"font-family:microsoft yahei;\"><span style=\"font-size:14px;\"><br />\r\n	</span></span></p>\r\n<p>\r\n	<span _fck_bookmark=\"1\" style=\"display: none;\">&nbsp;</span></p>\r\n<p align=\"left\" class=\"MsoNormal\">\r\n	<span style=\"font-family:microsoft yahei;\">尊敬的%contact_name%：</span></p>\r\n<p align=\"left\" class=\"MsoNormal\">\r\n	<span style=\"font-family:microsoft yahei;\"><span lang=\"EN-US\">&nbsp;</span></span></p>\r\n<p align=\"left\" class=\"MsoNormal\">\r\n	<span style=\"font-family:microsoft yahei;\"><span style=\"font-size:14px;\">我们很高兴的通知您，您的订单</span><span style=\"font-size: 14px; line-height: 20px;\">%order_serial%</span><span style=\"font-size:14px;\">已生效！</span><span style=\"font-size: 14px;\">感谢您对2014 CHAT上海的积极参与和支持！</span></span></p>\r\n<p align=\"left\" class=\"MsoNormal\">\r\n	<span style=\"font-family:microsoft yahei;\"><span style=\"font-size: 14px;\">&nbsp;</span></span></p>\r\n<p align=\"left\" class=\"MsoNormal\">\r\n	<span style=\"font-family:microsoft yahei;\"><font size=\"3\">CHAT上海将于9月17-18日在上海世博洲际大酒店举行，如果您需要以CHAT上海论坛优惠价入住我们的会议合作酒店，请点击</font><a href=\"http://www.chatchina.com.cn/wp-content/uploads/2014/01/venue_room_booking_order_zh.pdf\" style=\"font-family: verdana, geneva, sans-serif; font-size: 14px;\">此处</a><span style=\"font-size: 12pt;\">下载客房预订单并电邮至</span><span style=\"font-size: 12pt; color: rgb(51, 102, 255);\"><a href=\"mailto:rsvn@icshexpo.com\" style=\"font-size: 12pt;\">rsvn@icshexpo.com</a></span></span></p>\r\n<p align=\"left\" class=\"MsoNormal\">\r\n	<span style=\"font-family:microsoft yahei;\"><span style=\"font-size: 12pt;\">所有参会嘉宾的名牌将按照您注册时提供的信息打印。若在</span><span lang=\"EN-US\" style=\"font-size: 12pt;\">9</span><span style=\"font-size: 12pt;\">月</span><span lang=\"EN-US\" style=\"font-size: 12pt;\">8</span><span style=\"font-size: 12pt;\">日后有更改名牌上信息的需求将被收取</span><span lang=\"EN-US\" style=\"font-size: 12pt;\">200</span><span style=\"font-size: 12pt;\">元人民币变更费用。如有修改信息的需求请及时登录</span><span lang=\"EN-US\" style=\"font-size: 12pt;\">CHAT</span><span style=\"font-size: 12pt;\">网站报名页面</span><span lang=\"EN-US\" style=\"font-size: 12pt;\">&ldquo;</span><span style=\"font-size: 12pt;\">管理我的订单</span><span lang=\"EN-US\" style=\"font-size: 12pt;\">&rdquo;</span><span style=\"font-size: 12pt;\">修改信息。</span><span style=\"font-size: 12pt;\">您的订单验证码：</span><font size=\"3\">%certificate_number%</font><span style=\"font-size: 12pt;\">。</span><span style=\"font-size: 12pt;\">有发票需求并在注册时留下准确信息的与会者须在会议现场统一领取发票，逾期将不予受理。</span></span></p>\r\n<p align=\"left\" class=\"MsoNormal\">\r\n	<span style=\"font-family:microsoft yahei;\"><span style=\"font-size: 14px;\">同时也邀请您下载我们的手机应用程序并关注我们的微信公众账号，获取最新的CHAT上海会议资讯。扫描以下二维码关注APP和微信公众账号（或者直接搜索微信公共账号：chatconference）。</span></span></p>\r\n<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\" style=\"width: 400px;\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align: center;\">\r\n				<span style=\"font-family:microsoft yahei;\"><span style=\"font-size:14px;\"><img alt=\"\" height=\"155\" src=\"http://api.chatchina.com.cn/img/qrcode.png\" width=\"155\" /></span></span></td>\r\n			<td style=\"text-align: center;\">\r\n				<span style=\"font-family:microsoft yahei;\"><span style=\"font-size:14px;\"><img alt=\"\" height=\"168\" src=\"http://api.chatchina.com.cn/img/chat_weixin.jpg\" width=\"168\" /></span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align: center;\">\r\n				<span style=\"font-family:microsoft yahei;\"><span style=\"font-size:14px;\">手机应用APP</span></span></td>\r\n			<td style=\"text-align: center;\">\r\n				<span style=\"font-family:microsoft yahei;\"><span style=\"font-size:14px;\">微信公众账号</span></span></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<p>\r\n	<span style=\"font-family:microsoft yahei;\"><br />\r\n	<span style=\"font-size: 14px;\">若有任何问题，请拨打电话 +86(0)10 8518 6636 或 8518 1833。再次感谢您对我们工作的支持！</span></span></p>\r\n<p align=\"left\" class=\"MsoNormal\">\r\n	<span style=\"font-family:microsoft yahei;\"><br />\r\n	</span></p>\r\n<p align=\"left\" class=\"MsoNormal\">\r\n	<span style=\"font-family:microsoft yahei;\"><span style=\"font-size: 14px;\">　　顺祝</span></span></p>\r\n<p align=\"left\" class=\"MsoNormal\">\r\n	<span style=\"font-family:microsoft yahei;\"><span style=\"font-size: 14px;\">商祺！</span></span></p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-family:microsoft yahei;\"><span style=\"font-size: 14px;\"><span lang=\"EN-US\">&nbsp;</span></span></span></p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-family:microsoft yahei;\"><span style=\"font-size: 14px;\"><span lang=\"EN-US\">CHAT&nbsp;</span>会务组</span></span></p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-family:microsoft yahei;\"><span style=\"font-size:14px;\"><span lang=\"EN-US\">&nbsp;</span></span></span></p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-family:microsoft yahei;\"><span style=\"font-size:14px;\"><span lang=\"EN-US\">Dear %contact_name%</span>,</span></span></p>\r\n<p align=\"left\" class=\"MsoNormal\">\r\n	<span style=\"font-family:microsoft yahei;\"><span style=\"font-size:14px;\"><span lang=\"EN-US\">&nbsp;</span></span></span></p>\r\n<p align=\"left\" class=\"MsoNo