. <span style=\"color:black;mso-themecolor:text1\">The Fa Piao will be printed according to the registered Fa Piao title and distributed during the event. Please note the CHAT host will not held responsible for any request afterwards.</span></span></span></p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-bottom: 14pt;\">\r\n	<span style=\"font-family:microsoft yahei;\"><span lang=\"EN-US\" style=\"font-size: 12pt;\">Please also download our mobile CHAT APP and follow us in WeChat by scanning the QR code below (or search wechat public account: chatconference).</span></span></p>\r\n<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\" style=\"width: 400px;\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align: center;\">\r\n				<span style=\"font-family:microsoft yahei;\"><span style=\"font-size:14px;\"><img alt=\"\" height=\"155\" src=\"http://api.chatchina.com.cn/img/qrcode.png\" width=\"155\" /></span></span></td>\r\n			<td style=\"text-align: center;\">\r\n				<span style=\"font-family:microsoft yahei;\"><span style=\"font-size:14px;\"><img alt=\"\" height=\"168\" src=\"http://api.chatchina.com.cn/img/chat_weixin.jpg\" width=\"168\" /></span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align: center;\">\r\n				<span style=\"font-family:microsoft yahei;\"><span style=\"font-size:14px;\">Mobile APP</span></span></td>\r\n			<td style=\"text-align: center;\">\r\n				<span style=\"font-family:microsoft yahei;\"><span style=\"font-size:14px;\">WeChat Public Account</span></span></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-bottom: 14pt;\">\r\n	<span style=\"font-family:microsoft yahei;\"><br />\r\n	</span></p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"margin-bottom: 14pt;\">\r\n	<span style=\"font-family:microsoft yahei;\"><span style=\"font-size: 14px;\">Should you have any inquire, please don&#39;t hesitate to contact us at +86(0)10 8518 6636 or 8518 1833.</span></span></p>\r\n<p align=