INSERT INTO `end_wt_email_template_data` VALUES ('6', 'chat_success_host', 'CHAT订单支付成功提醒', '<p style=\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, Helvetica, sans-serif, 宋体; line-height: 20px;\">\r\n	您好！</p>\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, Helvetica, sans-serif, 宋体; line-height: 20px;\">\r\n	CHAT会议参会者订单（订单号：%order_serial%<span style=\"color: rgb(34, 34, 34); font-family: Arial, Verdana, sans-serif;\">，联系人：%contact_name%，公司：%company_name%</span>）已经支付成功。</p>\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, Helvetica, sans-serif, 宋体; line-height: 20px;\">\r\n	&nbsp;</p>\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, Helvetica, sans-serif, 宋体; line-height: 20px;\">\r\n	_____________</p>\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, Helvetica, sans-serif, 宋体; line-height: 20px;\">\r\n	CHAT报名注册系统</p>\r\n', '', '1402246994', '1401768050', '1');
INSERT INTO `end_wt_email_template_data` VALUES ('7', 'chat_success_attendee', 'CHAT上海报名确认函 | CHAT Shanghai Confirmation of Registration', '<p align=\"left\" class=\"MsoNormal\">\r\n	<span style=\"font-family:microsoft yahei;\"><span style=\"font-size:12px;\">这是一封系统邮件，请勿回复！若有任何需求，请发送至<a href=\"mailto:lluo@horwathhtl.com\">lluo@horwathhtl.com</a>垂询，谢谢！/ This is an automatic email sent by the systerm, please do not reply! Should you have further questions, please contact&nbsp;<a href=\"mailto:lluo@horwathhtl.com\">lluo@horwathhtl.com</a></span></span></p>\r\n<p align=\"left\" class=\"MsoNormal\">\r\n	<span style=\"font-family:microsoft yahei;\"><span style=\"font-size:12px;\"><em>For English, please scroll down.</em></span></span></p>\r\n<hr />\r\n<p align=\"left\" class=\"MsoNormal\">\r\n	<span style=\"font-family:microsoft yahei;\"><span style=\"font-size:14px;\"><br />\r\n	</span></span></p>\r\n<p>\r\n	<span _fck_bookmark=\"1\" style=\"display: none;\">&nbsp;</span></p>\r\n<p align=\"left\" class=\"MsoNormal\">\r\n	<span style=\"font-size:14px;\"><span style=\"font-family:microsoft yahei;\">尊敬的%name_zh%：</span></span></p>\r\n<p align=\"left\" class=\"MsoNormal\">\r\n	<span style=\"font-size:14px;\"><span style=\"font-family:microsoft yahei;\"><span lang=\"EN-US\">&nbsp;</span></span></span></p>\r\n<p align=\"left\" class=\"MsoNormal\">\r\n	<span style=\"font-size:14px;\"><span style=\"font-family:microsoft yahei;\">感谢您报名参加于2014年9月17-18号在上海世博洲际大酒店举行的CHAT上海论坛活动！</span></span></p>\r\n<p align=\"left\" class=\"MsoNormal\">\r\n	<span style=\"font-size:14px;\"><span style=\"font-family:microsoft yahei;\">&nbsp;</span></span></p>\r\n<p align=\"left\" class=\"MsoNormal\">\r\n	<span style=\"font-size:14px;\"><span style=\"font-family:microsoft yahei;\">如果您需要以<span lang=\"EN-US\">CHAT</span>上海论坛优惠价入住我们的会议合作酒店<span lang=\"EN-US\">-</span>上海世博洲际大酒店，请点击<a href=\"http://www.chatchina.com.cn/wp-content/uploads/2014/01/venue_room_booking_order_zh.pdf\" style=\"font-family: verdana